import { makeStyles } from '@material-ui/core/styles';


export default makeStyles(() => ({
    paper: {
        margin: "5px",
        width: '250px',
        background: '#0021A5',
        color: 'blue'
    },
    grid: {
        width: '250px',
        margin: '5px',
        padding: '5px'
    },
    title: {
        margin: '5px',
        padding: '5px'
    },
    description: {
        margin: '5px',
        padding: '5px'
    },
    time: {
        margin: '5px',
        padding: '5px'
    },
    button: {
        padding: '5px',
        margin: '5px'
    },
}));
